function removeDuplicatesByUserId(array $fanStructs): array\n{\n    $uniqueFanStructs = [];\n    foreach ($fanStructs as $fanStruct) {\n        $uniqueFanStructs[$fanStruct->userid] = $fanStruct;\n    }\n    return array_values($uniqueFanStructs);\n}\n\n// Example usage:\n$fanStructs = [\n    new FanStruct('2023-01-01', 1),\n    new FanStruct('2023-01-02', 2),\n    new FanStruct('2023-01-03', 1), // Duplicate userid\n    new FanStruct('2023-01-04', 3),\n];\n\n$uniqueFanStructs = removeDuplicatesByUserId($fanStructs);\nprint_r($uniqueFanStructs);